import React from 'react';
import './App.css';


export default function Main() {
    return (
    <div className="section-container">
          <div className="about-container">
            <h3 className="sections section-title about">About</h3>
            <p className="sections section-info about">I am a frontend developer with a focus on React, JS, HTML, and CSS. I've been working in IT adjacent roles for almost 10 years, from Social Media Coordinator to Email Program Manager, and ready for something more programming focused.</p>
          </div>
          <div className="interests-container">
            <h3 className="sections section-title interests">Interests</h3>
            <p className="sections section-info interests">Father. Husband. Dog father. Board game enthusiast. Cyclist. Avid gym-goer. Coffee lover. DIYer. Coder</p>
          </div>
        </div>)}
